‚Å£‚Å£
Day 4 - What to heal on my root chakra?‚Å£‚Å£
‚Å£‚Å£
What's a chakra? Wheels of energy throughout the body.‚Å£‚Å£
‚Å£‚Å£
The root chakra (Muladhara) lies at the base of the spine. This chakra deals with how stable and secure we feel. Do we feel safe?‚Å£‚Å£
‚Å£‚Å£
7 of Pentacles ‚Å£‚Å£
‚Å£‚Å£
This is usually referred to as the harvest card. The fruit of your labor. ‚Å£‚Å£
‚Å£‚Å£
I recently realized that I have a bad habit of living in a state of lack even when things are overflowing. Im capable of getting a gift card for Christmas and I won't use it until the following Christmas because my thought process is, "when will I get another one again?" I can even do this with food where I'll eat it all because, "when will I have it again?". ‚Å£
‚Å£
Prosperity is like a water pipe. There is an opening at both ends of the pipe to allow water to flow freely. When we hold on too tight, we can create an energetic clog. Saving for a rainy day is one thing, holding on to dear life because this may be the last time you ever have it is very well another. ‚Å£‚Å£
‚Å£‚Å£
I continue to work on the feelings of scarcity I have at times. I know I'm safe, I know I'm secure. God, the universe, spirit always provides. Life is abundant as long as you allow it to be.‚Å£‚Å£
